import React from 'react';

const Recipe = ({title,calories,image,ingredients,healthLabels}) => {
    return (
        <div>
            <h1>{title}</h1>
            <p>{calories}</p>
            <ol>
                {ingredients.map(ingredient => (
                  <li>{ingredient.text}</li>  
                ))} 
                </ol>
            <p>Health Labels</p>
            <ol>
                {healthLabels.map(healthLabel => (
                  <li>{healthLabel}</li>  
                ))} 
                </ol>
            <img src= {image} alt="" />
        </div>
    )
}

export default Recipe;
